import React from "react"
import useSpring from "reacr-spring"

const spinIn = useSpring({
    config: {duration: 300},
    from: {transform: "rotateZ(360deg)", opacity: "0"},
    to: {transform: "rotateZ(0deg)", opacity: "1"},
    delay: 800
  })

export default spinIn;
